('2','1','	&lt;center&gt;COMPREHENSION PASSAGE &lt;br/&gt;\nRead the following passage and answer the questions on it.&lt;/center&gt; &lt;br/&gt;\n&lt;p&gt;People are unemployed when they have no jobs. They are idle. This causes a lot of problems for them and the society. Unemployed people are not happy. Since they have no jobs. They have no money to buy the things they need like food, clothes or accommodation. They also have no money to entertain themselves or their friends like those who are employed. They often compare themselves with people that have jobs and feel their standard is low. They feel inferior and sad. &lt;/p&gt;\n&lt;p&gt;In addition, persons who are employed often take to crime to provide what they need. Many of the men steal or rob and that is why there are frequent cases of armed robbery in the cities. The women become prostitutes and infect their customers with diseases. &lt;/p&gt;\n&lt;p&gt;	Unemployment also forces many children to stop schooling. They help drop out because their unemployed parents cannot pay school fees or provide the things they need in school. While their mates are in school receiving education that will make them important persons in future, unemployed peoples children roam the streets in towns and cities without the hope of achieving anything great in life. &lt;/p&gt;\n&lt;p&gt;	Government should take steps to check unemployment. When people are in school, they should be taught different skills or trades which they can practise if they do not have paid jobs. Apart from learning the normal school subjects, students should be taught trades like carpentry, fashion and design, electrical installation and electronics and so on. Employed people can also practise their trades as a hobby. \nFrom the options lettered A to E, choose the correct answers.&lt;/p&gt; &lt;br&gt;\n\n&lt;u&gt;Question 1&lt;/u&gt;&lt;br&gt;\nThey are idle. Another word for idle is  ______________\n','wanted','alone','unhappy','idol','jobless','optione','1'),
